import React from 'react';
import '../styles/Carros.css'; // Importando o CSS

// Dados dos carros com imagens
const categorias = [
  {
    nome: "VW",
    carros: [
      { nome: "Virtus", img: "path/to/vw-virtus.jpg" },
      { nome: "Voyage", img: "path/to/vw-voyage.jpg" },
      { nome: "Polo Track", img: "path/to/vw-polo-track.jpg" },
      { nome: "Gol", img: "path/to/vw-gol.jpg" },
    ]
  },
  {
    nome: "Hyundai",
    carros: [
      { nome: "Ioniq", img: "path/to/hyundai-ioniq.jpg" },
      { nome: "Sandero", img: "path/to/hyundai-sandero.jpg" },
      { nome: "Logan", img: "path/to/hyundai-logan.jpg" },
      { nome: "Duster", img: "path/to/hyundai-duster.jpg" },
    ]
  },
  {
    nome: "Nissan",
    carros: [
      { nome: "Versa", img: "path/to/nissan-versa.jpg" },
    ]
  },
  {
    nome: "Toyota",
    carros: [
      { nome: "Corolla", img: "path/to/toyota-corolla.jpg" },
      { nome: "Corolla Cross", img: "path/to/toyota-corolla-cross.jpg" },
      { nome: "Prius", img: "path/to/toyota-prius.jpg" },
      { nome: "Etios", img: "path/to/toyota-etios.jpg" },
    ]
  },
  {
    nome: "GM",
    carros: [
      { nome: "Spin", img: "path/to/gm-spin.jpg" },
      { nome: "Prisma", img: "path/to/gm-prisma.jpg" },
      { nome: "Onix Plus", img: "path/to/gm-onix-plus.jpg" },
    ]
  },
];

function Carros() {
  return (
    <section className="carros">
      <h2>Nossos Carros</h2>
      <div className="carros-list">
        {categorias.map((categoria) => (
          <div className="categoria" key={categoria.nome}>
            <h3>{categoria.nome}</h3>
            <div className="carros-grid">
              {categoria.carros.map((carro) => (
                <div className="carro" key={carro.nome}>
                  <img src={carro.img} alt={carro.nome} className="carro-imagem" />
                  <h4>{carro.nome}</h4>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Carros;
